import {WorksBoxStyled,
        WorksHeader,
        WorksList
} from "./Works.styled"

import {WorksCard} from "../Works/WorksCard/WorksCard"

export const Works = () => {
    return (
    <WorksBoxStyled>
        <WorksHeader>How it works</WorksHeader>
        <WorksList>
            <WorksCard />
            <WorksCard/>
            <WorksCard/>
        </WorksList>
        <button></button>
    </WorksBoxStyled>
    );
  };
